import React from 'react';
import Card from './Card';
import {robots} from './robots';

const CardList = ({robots}) => {
	const listOfCards = robots.map((user, i)=>{
		return <Card key = {i} name={user.name} email={user.email} />
		})
	return (
		<div>
			{listOfCards}
		</div>
		)
	}


export default CardList;
